    squareInfo.push('');
  }

  return (  
    <div className="App">
      <h1 style={{textAlign: 'center'}}> The Million Dollar NFT </h1>

      <br></br>
      <div class="homepage" style={{ borderStyle: 'solid',  margin: 'auto', height:'1100px', width:'1100px', backgroundColor: '#FFFF'}}>        
        {/* <Row style>/ */}
